import React from 'react';

import './header.css';
import { images } from '../../constants';

const Header = ({ title }) => (
  <div style={{ marginBottom: '1rem' }}>
    <p className="p__cormorant">{title}</p>
    <img src={images.spoon} alt="spoon_image" className="spoon__img" />
  </div>
);
export default Header;
